// Style loading function: candy
static void GuiLoadStyleCandy(void)
{
    // Load an populate global default style
    for (int i = 0; i < 20; i++) GuiSetStyle(DEFAULT, i, styleCandy[i]);

    // Set additional style properties (if required)

    // Custom font loading
    Image imFont = { candyFontData, 256, 256, 1, 2 };

    Font font = { 0 };
    font.baseSize = 15;
    font.glyphCount = 95;

    // Load texture from image
    font.texture = LoadTextureFromImage(imFont);

    // Copy char recs data from global candyFontRecs
    // NOTE: Required to avoid issues if trying to free font
    font.recs = (Rectangle *)malloc(font.glyphCount*sizeof(Rectangle));
    memcpy(font.recs, candyFontRecs, font.glyphCount*sizeof(Rectangle));

    // Copy font char info data from global candyFontChars
    // NOTE: Required to avoid issues if trying to free font
    font.glyphs = (GlyphInfo *)malloc(font.glyphCount*sizeof(GlyphInfo));
    memcpy(font.glyphs, candyFontChars, font.glyphCount*sizeof(GlyphInfo));

    GuiSetFont(font);
    
    //-----------------------------------------------------------------
    
    // Custom user style setup: Set specific properties here
    // i.e. Controls specific BORDER_WIDTH, TEXT_PADDING, TEXT_ALIGNMENT
    GuiSetStyle(BUTTON, BORDER_WIDTH, 2);
    GuiSetStyle(SLIDER, TEXT_PADDING, 4);
    GuiSetStyle(CHECKBOX, TEXT_PADDING, 4);
    GuiSetStyle(VALUEBOX, TEXT_PADDING, 4);
    GuiSetStyle(VALUEBOX, TEXT_ALIGNMENT, GUI_TEXT_ALIGN_LEFT);
    GuiSetStyle(STATUSBAR, TEXT_PADDING, 6);
    GuiSetStyle(STATUSBAR, TEXT_ALIGNMENT, GUI_TEXT_ALIGN_LEFT);
    
    // We setup a white character on the font to be used on
    // shapes drawing, this way we make sure all gui can be drawn
    // on a single pass because no texture cahnge is required
    // NOTE: Setting up this rectangle is a manual process
    Rectangle whiteChar = { 86, 4, 3, 3 };
    SetShapesTexture(font.texture, whiteChar);  
}
